@FranciscoGent13 @SrgioCampos20 Então se organizem e se ensinem a defender o direito constitucional de vcs, de desobedecer ordens ilegais e desumanas.

Na hora da depressão, da insônia, da ideação suicida, os comandantes deixam vcs na ponta do tridente.

Inda mais q eles deixaram vcs com aposentadorias de fome.
